import React from 'react';
import logo from './logo.svg';
import './App.css';
import Home from './pages/Home';
import Pages from './pages';
import { Route } from "react-router-dom";
import API from './pages/API';



function App() {
  return (  
  
    <div className="App">             
        <img src={logo} className="App-logo" alt="logo" />
      
            <Route path = "/Home">
                <Home />
            </Route>
            <Route path = "/API">
                <API />
            </Route>            
               
    </div>
   
  );
}

export default App;
